import React, { Component } from "react";
import "./App.css";
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Home from "./components/pages/Home";
import Register from './components/auth/Register';
import Login from './components/auth/Login';
import axios from "axios";
import { useState } from 'react';

import HomePage from "./components/pages/user/HomePage";
import AdminPage from "./components/pages/admin/AdminPage";


function App () {
      const t=window.sessionStorage.getItem("token");
      console.log('tt',t);
  const [ token, setLoginToken] = useState({});
  const [ user, setLoginUser] = useState({});


return (

      <Router>
        <Switch>


        <Route  exact path="/">
        <Home />
        </Route> 

        <Route   path="/login"> {(token!=='' && token!==null) ? <HomePage setLoginToken={setLoginToken}/>: <Login  setLoginToken={setLoginToken} setLoginUser={setLoginUser} />}</Route>


          <Route path="/register">
            <Register />
        </Route>
        <Route path="/login">
            <Login setLoginToken={setLoginToken} />
        </Route>


        <Route exact path="/AdminPage" component={AdminPage} />
        </Switch>
      </Router>

    );
  }

export default App;
